import React from "react";
import "./style.css";
import "../../../box-style.css";

export default function About() {
  return (
    <div className="anchor-box">
      <a name="about" href="/#">
        &nbsp;
      </a>
      <div id="about-container" className="box">
        <div id="about-box">
          <h1 id="about-h1">This is an about page</h1>

          <p>
            Hi, I'm Piper and I'm passionate about creativity, learning, and development. I'm currently on
            the School of Code bootcamp, where I'm learning all kinds of
            wonderful things to do with code and I'm loving every minute of it
            so far!
          </p>

        </div>
      </div>
    </div>
  );
}
